package bean;

public class SizeBean {
	private int MaSize;
	private int SoSize;
	private int MaSP;
	private long SoLuong;
	public SizeBean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public SizeBean(int maSize, int soSize, int maSP, long soLuong) {
		super();
		MaSize = maSize;
		SoSize = soSize;
		MaSP = maSP;
		SoLuong = soLuong;
	}
	public int getMaSize() {
		return MaSize;
	}
	public void setMaSize(int maSize) {
		MaSize = maSize;
	}
	public int getSoSize() {
		return SoSize;
	}
	public void setSoSize(int soSize) {
		SoSize = soSize;
	}
	public int getMaSP() {
		return MaSP;
	}
	public void setMaSP(int maSP) {
		MaSP = maSP;
	}
	public long getSoLuong() {
		return SoLuong;
	}
	public void setSoLuong(long soLuong) {
		SoLuong = soLuong;
	}
	
	
	
	
}
